description:
Greetz to all Filipino...

Mabuhay ang mga bayaning OFW...

ORIGINAL TITLE	Kamoteng kahoy
YEAR	
2009	 
RUNNING TIME	
90 min.
GENRE	Drama | Based on a true story
SYNOPSIS/PLOT: In a small village in Bohol, the unsuspecting townspeople suddenly fall gravely ill from a deadly poison. The culprit turns out to be an elderly woman who sells cassava cakes, who may have accidentally used a pesticide in her cooking.

